-- ----------------------------
-- Procedure structure for seeAll
-- ----------------------------
DROP PROCEDURE IF EXISTS `seeAll`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `seeAll`(IN `sprid` int)
BEGIN
	declare countBsc int(11);
	declare flag tinyint(1) default 0;
	declare bscid int(11);
	SELECT basic into bscid from gauge_spr_dtl where id= sprid;
	SELECT count(*) into countBsc from gauge_spr_dtl where basic = bscid and see=1;
	IF countBsc = 0 THEN
		SET flag = 1;
		UPDATE gauge_spr_bsc SET see = 0 WHERE id = bscid;
	END IF;
	SELECT flag,bscid;
END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for hvSeeAll
-- ----------------------------
DROP FUNCTION IF EXISTS `hvSeeAll`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `hvSeeAll`(`sprid` int) RETURNS tinyint(4)
BEGIN
	DECLARE bscid int(11);
	declare countBsc int(11);
	set @bscid = CONCAT('SELECT basic from gauge_spr_dtl where id= ',sprid);
	set @countBsc = CONCAT('SELECT count(*) from gague_spr_dtl where basic = ',bscid,' and see=1');
	IF countBsc = 0 THEN
		UPDATE gauge_spr_bsc SET see = 0 WHERE id = bscid;
	END IF;
	RETURN 0;
END
;;
DELIMITER ;
